import Header from '../header';
//import BurgerMenu from '../burger-menu';

export default class App extends React.Component {
    render() {
        this.onBtnHandler = () => {
            console.log('test', this.state);
        }
        this.open = () =>{ 
            return true;
        };
        return (
            <div>
                <Header 
                    onBtnClickHandler = {this.onBtnHandler}
                    open = {!this.open} />
            </div>
        );
    };
};
